import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { WorkflowExecution } from '../../types';
import api from '../../services/api';
import { Button, Card, CardBody, Modal } from '../common';
import { useLanguage } from '../../context/LanguageContext';

export function ExecutionList() {
  const navigate = useNavigate();
  const { t } = useLanguage();
  const [executions, setExecutions] = useState<WorkflowExecution[]>([]);
  const [isLoading, setIsLoading] = useState(true);
  const [error, setError] = useState<string | null>(null);
  const [actionLoading, setActionLoading] = useState<number | null>(null);
  const [confirmDelete, setConfirmDelete] = useState<WorkflowExecution | null>(null);

  useEffect(() => {
    loadExecutions();
  }, []);

  const loadExecutions = async () => {
    setIsLoading(true);
    try {
      const data = await api.getExecutions();
      setExecutions(data);
    } catch (err: any) {
      setError(err.message);
    } finally {
      setIsLoading(false);
    }
  };

  if (isLoading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-8 w-8 border-b-2 border-primary-600"></div>
      </div>
    );
  }

  const statusColors: Record<string, string> = {
    pending: 'bg-secondary-100 text-secondary-700',
    running: 'bg-blue-100 text-blue-700',
    paused: 'bg-yellow-100 text-yellow-700',
    completed: 'bg-green-100 text-green-700',
    failed: 'bg-red-100 text-red-700',
  };

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex items-center justify-between">
        <div>
          <h1 className="text-2xl font-bold text-secondary-900">Executions</h1>
          <p className="text-secondary-600 mt-1">
            View and manage your workflow executions
          </p>
        </div>
        <Button onClick={() => navigate('/')}>
          Start New Workflow
        </Button>
      </div>

      {error && (
        <div className="bg-red-50 text-red-700 px-4 py-3 rounded-lg">
          {error}
        </div>
      )}

      {/* Execution List */}
      {executions.length === 0 ? (
        <Card>
          <CardBody className="text-center py-12">
            <p className="text-secondary-600 mb-4">
              No executions yet. Start a workflow to see it here.
            </p>
            <Button onClick={() => navigate('/')}>
              Go to Dashboard
            </Button>
          </CardBody>
        </Card>
      ) : (
        <div className="space-y-4">
          {executions.map((execution) => (
            <Card
              key={execution.id}
              hoverable
              onClick={() => navigate(`/executions/${execution.id}`)}
            >
              <CardBody className="flex items-center justify-between">
                <div className="flex items-center space-x-4">
                  <StatusIcon status={execution.status} />
                  <div>
                    <h3 className="font-medium text-secondary-900">
                      {execution.recipe_name || `Recipe #${execution.recipe_id}`}
                    </h3>
                    <p className="text-sm text-secondary-500">
                      Execution #{execution.id}
                    </p>
                  </div>
                </div>
                <div className="flex items-center space-x-6">
                  <span className={`px-3 py-1 text-sm font-medium rounded-full ${statusColors[execution.status]}`}>
                    {execution.status}
                  </span>
                  <div className="text-right">
                    <p className="text-sm text-secondary-900">
                      {execution.current_step} / {execution.total_steps || '?'} steps
                    </p>
                    <p className="text-xs text-secondary-500">
                      {formatDate(execution.created_at)}
                    </p>
                  </div>
                </div>
              </CardBody>
            </Card>
          ))}
        </div>
      )}
    </div>
  );
}

function StatusIcon({ status }: { status: string }) {
  switch (status) {
    case 'completed':
      return (
        <div className="w-10 h-10 rounded-full bg-green-100 flex items-center justify-center">
          <svg className="w-6 h-6 text-green-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M5 13l4 4L19 7" />
          </svg>
        </div>
      );
    case 'running':
      return (
        <div className="w-10 h-10 rounded-full bg-blue-100 flex items-center justify-center">
          <div className="w-5 h-5 border-2 border-blue-600 border-t-transparent rounded-full animate-spin"></div>
        </div>
      );
    case 'paused':
      return (
        <div className="w-10 h-10 rounded-full bg-yellow-100 flex items-center justify-center">
          <svg className="w-6 h-6 text-yellow-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 9v6m4-6v6m7-3a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
        </div>
      );
    case 'failed':
      return (
        <div className="w-10 h-10 rounded-full bg-red-100 flex items-center justify-center">
          <svg className="w-6 h-6 text-red-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4m0 4h.01M21 12a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
        </div>
      );
    default:
      return (
        <div className="w-10 h-10 rounded-full bg-secondary-100 flex items-center justify-center">
          <svg className="w-6 h-6 text-secondary-400" fill="none" stroke="currentColor" viewBox="0 0 24 24">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
          </svg>
        </div>
      );
  }
}

function formatDate(dateString: string): string {
  const date = new Date(dateString);
  const now = new Date();
  const diff = now.getTime() - date.getTime();

  if (diff < 60000) {
    return 'Just now';
  } else if (diff < 3600000) {
    const mins = Math.floor(diff / 60000);
    return `${mins} minute${mins > 1 ? 's' : ''} ago`;
  } else if (diff < 86400000) {
    const hours = Math.floor(diff / 3600000);
    return `${hours} hour${hours > 1 ? 's' : ''} ago`;
  } else {
    return date.toLocaleDateString();
  }
}
